import styles from './BottomNavBar.module.scss'
import { Link } from "react-router-dom";

export const BottomNavBar = () => {
	return (
		<div className={ styles.BottomNavBar }>
			<Link to="/">
				<img src="" />
			</Link>
		</div>
	)
}
